    dataIndex: 'c1',
    width: 78,
    headerCellStyle:{'text-align' : 'center'},
    bodyCellStyle : {'text-align' : 'right'},
  },
  {
    title: () => {
      return (
        <div>
          <p>在职<br/>G人数</p>
        </div>
      )
    },
    dataIndex: 'g',
    headerCellStyle:{'text-align' : 'center'},
    bodyCellStyle : {'text-align' : 'right'},
    width: 72,
  },
  {
    title: () => {
      return (
        <div>
          <p>在职<br/>C2人数</p>
        </div>
      )
